class AdDetect{constructor(){this.bannerList=["pub_300x250","pub_300x250m","pub_728x90","text-ad","textAd","text_ad","text_ads","text-ads","text-ad-links","ad-","ad_","_ad_","ads-","-ads-","ads_","_ads_","-ads-","_ads_","ad","ads","blog_ad","blog-ad","ad-blog","ad_blog","adsbygoogle"],this.init()}init(){var t=this.createDiv();document.body.insertAdjacentHTML("beforeend",t)}check(){var t=document.defaultView.getComputedStyle(document.getElementById("ad_blocker_bait"),null);return"none"===t.display||"hidden"===t.visibility}createDiv(){return`<div id="ad_blocker_bait" class="${this.bannerList.join(" ")}"></div>`}}export default new AdDetect;